import React, { Component } from 'react'

export default class Positions extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        positions: []
      };
    }

    async componentDidMount() {
        const url = 'http://vkovalov.me/wp-json/wp/v2/pages/17';
        const response = await fetch(url);
        const data = await response.json();
        const positions = await data.acf.positions.json();
        console.log(positions);
        this.setState({
            isLoaded: true,
            positions: positions
        });
    }

    render() {
      const { isLoaded, positions } = this.state;
      if (!isLoaded) {
        return <div>Завантаження...</div>;
      } else {
        return (
          <ul>
            {positions.map(position => (
              <li key={position}>
                {position}
              </li>
            ))}
          </ul>
        );
      }
    }
  }
